// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "./NFTMarketplace.sol";

/**
 * @title ERC721Collections
 * @dev A contract for creating and managing NFT collections. Inherits from OpenZeppelin's ERC721URIStorage and Ownable contracts.
 */
contract ERC721Collections is ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdTracker;
    Counters.Counter private _collectionIdTracker;

    uint256 constant MAX_COLLECTIONS_PER_ADDRESS = 999;
    uint256 constant TIME_BETWEEN_COLLECTIONS = 1 minutes;
    uint256 public constant MIN_PRICE = 0.01 ether;
    uint256 public constant MAX_PRICE = 10000 ether;

    struct Collection {
        string uri;
        uint256 id;
        address owner;
    }

    NFTMarketplace private _marketplace;

    modifier onlyMarketplace() {
        require(
            msg.sender == address(_marketplace),
            "Caller is not the marketplace"
        );
        _;
    }

    mapping(uint256 => Collection) private _collections;
    mapping(uint256 => uint256[]) private _nftCollections; // Mapping from collection ID to list of token IDs
    mapping(uint256 => uint256) private _nftToCollection; // Mapping from token ID to collection ID
    mapping(uint256 => uint256) private _tokenPrices; // Mapping from token ID to its price

    mapping(address => uint256) public collectionsCreated;
    mapping(address => uint256) public lastCollectionTimestamp;

    event CollectionCreated(uint256 id, string uri);
    event TokenMinted(uint256 tokenId, uint256 collectionId);
    event PriceSet(uint256 tokenId, uint256 price);

    constructor(
        string memory publicCollectionURI
    ) ERC721("ERC721Collections", "STR") {
        createCollection(publicCollectionURI);
        _tokenIdTracker.increment();
    }

    function setMarketplace(
        address payable marketplaceAddress
    ) public onlyOwner {
        require(
            address(_marketplace) == address(0),
            "Marketplace address has already been set"
        );
        require(marketplaceAddress != address(0), "Invalid address");
        _marketplace = NFTMarketplace(marketplaceAddress);
    }

    function getCollection(uint256 id) public view returns (Collection memory) {
        return _collections[id];
    }

    function getCollectionOfToken(
        uint256 tokenId
    ) public view returns (Collection memory) {
        require(
            _nftToCollection[tokenId] != 0,
            "Token does not belong to any collection"
        );
        uint256 collectionId = _nftToCollection[tokenId];
        return _collections[collectionId];
    }

    function getNFTsInCollection(
        uint256 collectionId,
        uint256 startIndex,
        uint256 pageSize
    ) public view returns (uint256[] memory) {
        uint256[] storage allTokens = _nftCollections[collectionId];
        require(allTokens.length > 0, "Array is empty");
        require(startIndex < allTokens.length, "Invalid start index");
        if (pageSize > 100) {
            pageSize = 100;
        }
        uint256 endIndex = startIndex + pageSize;
        if (endIndex > allTokens.length) {
            endIndex = allTokens.length;
        }

        uint256[] memory tokens = new uint256[](endIndex - startIndex);
        for (uint256 i = startIndex; i < endIndex; i++) {
            tokens[i - startIndex] = allTokens[i];
        }

        return tokens;
    }

    function getPrice(uint256 tokenId) public view returns (uint256) {
        return _tokenPrices[tokenId];
    }

    function getCollectionOwner(
        uint256 collectionId
    ) external view returns (address) {
        return _collections[collectionId].owner;
    }

    function setPrice(uint256 tokenId, uint256 price) public returns (uint256) {
        require(price >= MIN_PRICE, "Price must be at least MIN_PRICE");
        require(price <= MAX_PRICE, "Price must not exceed MAX_PRICE");
        require(
            _isApprovedOrOwner(_msgSender(), tokenId),
            "ERC721: transfer caller is not owner nor approved"
        );
        require(
            !_marketplace.isTokenListed(tokenId),
            "Token is currently listed for sale"
        );
        _tokenPrices[tokenId] = price;

        emit PriceSet(tokenId, price);

        return _tokenPrices[tokenId];
    }

    function createCollection(string memory uri) public returns (uint256) {
        require(
            collectionsCreated[msg.sender] < MAX_COLLECTIONS_PER_ADDRESS,
            "Max collections reached"
        );
        require(
            lastCollectionTimestamp[msg.sender] + TIME_BETWEEN_COLLECTIONS <=
                block.timestamp,
            "Must wait before creating another collection"
        );

        _collectionIdTracker.increment();

        _collections[_collectionIdTracker.current()] = Collection({
            uri: uri,
            id: _collectionIdTracker.current(),
            owner: msg.sender
        });

        collectionsCreated[msg.sender]++;
        lastCollectionTimestamp[msg.sender] = block.timestamp;

        emit CollectionCreated(_collectionIdTracker.current(), uri);

        return _collectionIdTracker.current();
    }

    function mint(
        uint256 collectionId,
        string memory tokenURI,
        uint256 price
    ) public returns (uint256) {
        require(price >= MIN_PRICE, "Price must be at least MIN_PRICE");
        require(price <= MAX_PRICE, "Price must not exceed MAX_PRICE");
        require(
            _collections[collectionId].id != 0,
            "Collection does not exist"
        );
        require(
            collectionId == 1 || _collections[collectionId].owner == msg.sender,
            "Not the owner of the collection"
        );
        uint256 newTokenId = _tokenIdTracker.current();
        _tokenIdTracker.increment();
        _mint(msg.sender, newTokenId);
        _setTokenURI(newTokenId, tokenURI);
        _nftToCollection[newTokenId] = collectionId;
        _nftCollections[collectionId].push(newTokenId);
        _tokenPrices[newTokenId] = price;

        emit TokenMinted(newTokenId, collectionId);

        return newTokenId;
    }

    function lazyMint(
        uint256 collectionId,
        string memory tokenURI,
        uint256 price,
        address to
    ) public onlyMarketplace returns (uint256) {
        require(price >= MIN_PRICE, "Price must be at least MIN_PRICE");
        require(price <= MAX_PRICE, "Price must not exceed MAX_PRICE");
        require(
            _collections[collectionId].id != 0,
            "Collection does not exist"
        );

        uint256 newTokenId = _tokenIdTracker.current();
        _tokenIdTracker.increment();
        _mint(to, newTokenId);
        _setTokenURI(newTokenId, tokenURI);
        _nftToCollection[newTokenId] = collectionId;
        _nftCollections[collectionId].push(newTokenId);
        _tokenPrices[newTokenId] = price;

        emit TokenMinted(newTokenId, collectionId);
        return newTokenId;
    }
}

contracts/NFTMarketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/finance/PaymentSplitter.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

interface IERC721Collections is IERC721 {
    function getPrice(uint256 tokenId) external view returns (uint256 price);

    function getCollectionOwner(
        uint256 collectionId
    ) external view returns (address);

    function setPrice(uint256 tokenId, uint256 price) external;

    function lazyMint(
        uint256 collectionId,
        string memory tokenURI,
        uint256 price,
        address to
    ) external returns (uint256);
}

/**
 * @title NFTMarketplace
 * @dev A contract for buying and selling NFTs, with support for royalties.
 * Inherits from OpenZeppelin's Ownable, ReentrancyGuard, and PaymentSplitter contracts.
 */
contract NFTMarketplace is Ownable, ReentrancyGuard, PaymentSplitter {
    using SafeMath for uint256;
    /**
     * @dev IERC721Collections - an interface to interact with the NFT Collections contract.
     */
    IERC721Collections private _nftContract;

    /**
     * @dev The percentage of the sale price that will be kept as royalties
     */
    uint256 private _royalties;
    uint256 public constant MIN_PRICE = 0.01 ether;
    uint256 public constant MAX_PRICE = 10000 ether;

    mapping(uint256 => bool) private _listedTokens;

    struct MintRequest {
        uint256 collectionId;
        string tokenURI;
        uint256 price;
        address buyer;
        bool approved;
    }

    mapping(uint256 => MintRequest) public mintRequests;
    uint256 public mintRequestIdTracker = 1;

    event NFTListed(uint256 indexed tokenId);
    event NFTDelisted(uint256 indexed tokenId);
    event NFTBought(uint256 indexed tokenId);
    event MintRequestApproved(uint256 requestId, uint256 tokenId);
    event TokenMintRequest(
        uint256 indexed requestId,
        address buyer,
        string tokenURI,
        uint256 price
    );

    constructor(
        address nftContractAddress,
        address[] memory payees,
        uint256[] memory shares,
        uint256 royalties
    ) PaymentSplitter(payees, shares) {
        require(payees.length > 0, "At least one payee is required");
        require(
            payees.length == shares.length,
            "Payees and shares length must match"
        );
        _nftContract = IERC721Collections(nftContractAddress);
        _royalties = royalties;
    }

    function isTokenListed(uint256 tokenId) public view returns (bool) {
        return _listedTokens[tokenId];
    }

    /**
     * @dev Lists an NFT for sale.
     * Requirements:
     * - The caller must be the owner of the NFT.
     * - The marketplace contract must be approved to manage all NFTs of the owner.
     * - The NFT must not be already listed for sale.
     * - The price must be greater than 0.
     */
    function listNFT(uint256 tokenId, uint256 newPrice) public nonReentrant {
        require(newPrice >= MIN_PRICE, "Price must be at least MIN_PRICE");
        require(newPrice <= MAX_PRICE, "Price must not exceed MAX_PRICE");
        require(!_listedTokens[tokenId], "NFT already listed");
        require(
            _nftContract.ownerOf(tokenId) == msg.sender,
            "Must be owner of the NFT"
        );
        require(
            _nftContract.isApprovedForAll(msg.sender, address(this)) ||
                _nftContract.getApproved(tokenId) == address(this),
            "Must approve marketplace to manage the NFT"
        );

        _nftContract.setPrice(tokenId, newPrice);
        _listedTokens[tokenId] = true;

        emit NFTListed(tokenId);
    }

    function delistNFT(uint256 tokenId) public nonReentrant {
        require(
            msg.sender == _nftContract.ownerOf(tokenId) ||
                msg.sender == owner(),
            "Caller is not owner of NFT or marketplace"
        );
        require(_listedTokens[tokenId], "NFT not listed");

        _listedTokens[tokenId] = false;

        emit NFTDelisted(tokenId);
    }

    function buyNFT(
        uint256 tokenId,
        uint256 collectionId,
        string memory tokenURI
    ) public payable nonReentrant {
        uint256 price;
        address nftOwner;

        if (tokenId != 0) {
            require(_listedTokens[tokenId], "NFT not listed for sale");
            price = _nftContract.getPrice(tokenId);
            nftOwner = _nftContract.ownerOf(tokenId);
            require(nftOwner != msg.sender, "Owner cannot buy their own NFT");
            require(
                msg.value == price,
                "Sent value does not match the NFT price"
            );

            uint256 royaltiesAmount = price.mul(_royalties).div(100);

            require(
                price > royaltiesAmount,
                "Price should be higher than total royalties"
            );
            uint256 sellerAmount = price.sub(royaltiesAmount);

            _listedTokens[tokenId] = false;

            (bool success, ) = payable(nftOwner).call{value: sellerAmount}("");
            require(success, "Transfer to NFT owner failed.");

            _nftContract.transferFrom(nftOwner, msg.sender, tokenId);

            emit NFTBought(tokenId);
        } else {
            require(msg.value >= MIN_PRICE, "Price must be at least MIN_PRICE");
            require(msg.value <= MAX_PRICE, "Price must not exceed MAX_PRICE");
            require(
                bytes(tokenURI).length > 0,
                "Token URI is required for minting"
            );
            require(collectionId != 1, "");
            require(collectionId != 0, "Collection ID is required for minting");
            address collectionOwner = _nftContract.getCollectionOwner(
                collectionId
            );
            (collectionId);
            require(
                collectionOwner != msg.sender,
                "Collection owner should not request NFTs in their own collection"
            );
            mintRequests[mintRequestIdTracker] = MintRequest({
                collectionId: collectionId,
                tokenURI: tokenURI,
                price: msg.value,
                buyer: msg.sender,
                approved: false
            });

            emit TokenMintRequest(
                mintRequestIdTracker,
                msg.sender,
                tokenURI,
                msg.value
            );

            mintRequestIdTracker++;
        }
    }

    function approveMintRequest(uint256 requestId) public nonReentrant {
        MintRequest storage request = mintRequests[requestId];
        require(request.buyer != address(0), "Mint request does not exist");
        require(!request.approved, "Mint request already approved");
        address collectionOwner = _nftContract.getCollectionOwner(
            request.collectionId
        );
        require(
            collectionOwner == msg.sender,
            "Only the collection owner can approve the mint request"
        );
        uint256 royaltiesAmount = request.price.mul(_royalties).div(100);
        require(
            request.price > royaltiesAmount,
            "Price should be higher than total royalties"
        );

        uint256 collectionOwnerAmount = request.price.sub(royaltiesAmount);

        (bool success, ) = payable(collectionOwner).call{
            value: collectionOwnerAmount
        }("");
        require(success, "Transfer to Collection owner failed.");

        uint256 tokenId = _nftContract.lazyMint(
            request.collectionId,
            request.tokenURI,
            request.price,
            request.buyer
        );
        request.approved = true;
        emit MintRequestApproved(requestId, tokenId);
        emit NFTBought(tokenId);
    }
}

